import React from 'react';

import UserList from './UserList2';

function App2() {
  const users = [
    {
      id: 1,
      username: 'velopert',
      email: 'public.velopert@gmail.com'
    },
    {
      id: 2,
      username: 'tester',
      email: 'tester@example.com'
    },
    {
      id: 3,
      username: 'liz',
      email: 'liz@example.com'
    }
  ];
  return (
      <>
        <span>App2</span>
        <UserList users={users} />
      </>
  );
}

export default App2;
